import React, {useState} from 'react';
import Form from './Form';
import './App.css';

function App() {
  const [data, setData] = useState([]);
  const getDataHandler = (event) =>{
    setData([...data, event])
  }
  return (
    <div>
      <Form getdata={getDataHandler}/>
    </div>
  );
}

export default App;
